import '../App.css';
import React from 'react';



const About = () => {

return (
    <div className="App-about">
	    <body className="App-about-body">


		    <p><h1>About</h1></p>
		    <p>
		    <h2>I'm Pete and I live in Miami.  Before COVID hit I was experimenting with stand up comedy just as something to do.  When COVID hit, I spent a lot of free time learning how to code.  I was experimenting mostly with Python and how I could use that with 3D printing. All of that stopped when I had the idea for Pobblebonk late in 2020.  I was working on the idea then had it pop in my head that I need to put it on a mobile app in early 2021.  I've been working on that mobile app ever since.  The Pobblebonk project is a long term side project. I only work on it during my free time as dictated by my actual job and other activities.  This project may be something that could end in 2022 for good or it could potentially be something I just keep working on for a decade or more depending on peoples' interest.  Ultimately, the overarching question I'll always have in the background is:<b> Are we improving the art of stand up?</b>  If the answer to that is no, then we either have to change or quit.
		    </h2></p>
			    <h2>
			    I hope to expand more on what I'm doing in the future but just know that I'm trying to take stand up comedy into the future!</h2>





	    </body>

    </div>



);



}

export default About;
